import React, { Component } from "react";
import contact from "./Images/contact.jpg";

class Contact extends Component {
  constructor(props) {
    super(props);

    this.state = {};
  }

  render() {
    return (
      <div
        style={{
          backgroundImage: `url(${contact})`,
          height: "1000px",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
          backgroundSize: "cover",
        }}
      >
        <div>
          <h1 style={{ text: "white" }}>CONTACT </h1>
          <br />
          <br />

          <center>
            <table border="4" className="table table-bordered table-solid">
              <tr>
                &nbsp;<th>Name </th> &nbsp;
                <th>Email ID</th>&nbsp;
                <th>Contact Number</th>&nbsp;&nbsp;
              </tr>
              <tr>
                &nbsp; <td>Aditya Dada Palkar</td>&nbsp;
                <td>apalkar@gmail.com</td>&nbsp;
                <td>9130812106</td>&nbsp;&nbsp;
              </tr>

              <tr>
                &nbsp; <td>Abhijit Bhau Wagh</td>&nbsp;
                <td>abhibhau@gmail.com</td>&nbsp;
                <td>7219554986</td>&nbsp;&nbsp;
              </tr>

              <tr>
                &nbsp; <td>Aditi Tai Pawar</td>&nbsp;
                <td>Taisaheb@gmail.com</td>&nbsp;
                <td>9657835855</td>&nbsp;&nbsp;
              </tr>

              <tr>
                &nbsp; <td>Aditya Dada Deshmukh</td>&nbsp;
                <td>DeshmukhMyBoy@gmail.com</td>&nbsp;
                <td>7719907801</td>&nbsp;&nbsp;
              </tr>

              <tr>
                &nbsp; <td>Wath Baba Backchod</td>&nbsp;
                <td>90%@gmail.com</td>&nbsp;
                <td>7387279721</td>&nbsp;&nbsp;
              </tr>

              <tr>
                &nbsp; <td>Atharva Bondre</td>&nbsp;
                <td>atharva@gmail.com</td>&nbsp;
                <td>7387807425</td>&nbsp;&nbsp;
              </tr>
            </table>
          </center>
        </div>
      </div>
    );
  }
}

export default Contact;
